import React from 'react';
import { Link } from 'react-router-dom';
import './Home.css';

function Home() {
  return (
    <div className="page home">
      <div className="container">
        <h1 className="hero-title">Hi, I'm <span className="highlight">Nirjala Deshar</span></h1>
        <p className="hero-subtitle">Computer Engineering Student</p>
        <p className="hero-description">
          Front-End Developer | UI/UX Designer | Graphic Design Enthusiast
        </p>
        <div className="hero-btns">
          <Link to="/projects" className="btn">View My Work</Link>
          <a href="/cv.pdf" className="btn-outline" target="_blank" rel="noopener noreferrer">Resume</a>
        </div>
      </div>
    </div>
  );
}

export default Home;
